import React from "react";

import { Layout } from '../layout';
const Home = () => (
    <Layout>
        <h1 className='text-2xl p-2 text-center'>Sofia'a first Miltipage App
        </h1>
        <p className='p-2'>The student of 21 school</p>
        <p className='p-2'>My GitHub</p>
        <p className='text-2xl p-2 text-center'>https://github.com/SofiaYooou</p>
    </Layout>
);

export default Home;
